import React from 'react';

function Header() {
  return (
    <div>
      <bnt data-testid="profile-top-btn"><img src="src/imagens/profileIcon.svg" alt="perfil" /></bnt>
      <h1 data-testid="page-title">Comidas</h1>
      <bnt data-testid="search-top-btn"><image src="src/imagens/searchIcon.svg" alt="search" /></bnt>
    </div>
  );
}

export default Header;
